    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Weisen Sie die Anzahl der Prozessorthreads f\u00fcr den Aufbau von Tunnels zu. Wenn Ihr Prozessor Hyper-Threading oder gleichzeitiges Multithreading unterst\u00fctzt, k\u00f6nnen Sie die Anzahl der Prozessorkerne mit 2 multiplizieren, um die maximale Anzahl der zuzuweisenden Threads zu erhalten, andernfalls entspricht die Anzahl der Prozessorkerne der maximal verf\u00fcgbaren Threads. Beachten Sie, dass Sie m\u00f6glicherweise weniger als das theoretische Maximum zuweisen m\u00f6chten, um Spielraum f\u00fcr andere Aufgaben zu haben.";
