    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Wenn ein neuer Diensttunnel erstellt wird oder ein Dienst zum ersten Mal ausgef\u00fchrt wird (z. B. der Standard-Jetty-Webserver, Plugins), wird ein privater Verschl\u00fcsselungsschl\u00fcssel erstellt, der im Wesentlichen die Eigent\u00fcmerschaft der Adresse steuert. Dies ist normalerweise als <code>&hellip;privKey.dat</code> oder <code>eepPriv.dat</code> benannt, obwohl es eine gute Idee ist, den Namen zu \u00e4ndern, um den Dienst anzugeben, dem er geh\u00f6rt, und ihn dann in den Servereinstellungen des Tunnelmanagers erneut anzugeben. Diese .dat-Datei sollte sicher gesichert werden. Verlieren Sie sie und Sie verlieren die Eigent\u00fcmerschaft und Kontrolle \u00fcber Ihren Hostnamen!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Diese Einstellung erm\u00f6glicht die Konfiguration der maximalen Anzahl von Dateien pro Torrent, die I2PSnark beim Herunterladen oder Erstellen eines Torrents erlaubt. Beachte, dass eine substanzielle Erh\u00f6hung dieses Wertes \u00fcber den Standard von 2000 Dateien zus\u00e4tzliche Konfigurationen des Hostsystems erfordern kann, um die maximale Anzahl von vom Betriebssystem erlaubten offenen Dateien zu erh\u00f6hen (z.B. <code>ulimit -n</code> unter Linux). Zum \u00c4ndern werden Werte der Konfigurationsdatei von I2PSnark <code>i2psnark.config</code> hinzugef\u00fcgt. [Neustart von I2PSnark oder Router erforderlich]";
    t[370] = "Configure router bandwidth allocation";
