    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "Hier sind einige andere \u00f6ffentliche Adressbuch-Abonnement-Links. Sie k\u00f6nnen ein oder zwei zu Ihrer <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns Abonnementliste</a> hinzuf\u00fcgen. Wenn sich Adressen in den Abonnements \u00fcberschneiden, haben die ganz oben in Ihrer susidns-Konfiguration platzierten Listen Vorrang vor denen, die weiter unten platziert wurden.";
