    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Ein Eepsite ist eine Website, die anonym im I2P-Netzwerk gehostet wird - Sie k\u00f6nnen darauf zugreifen, indem Sie Ihren Webbrowser so konfigurieren, dass er den HTTP-Proxy von I2P verwendet (siehe oben) und zu einer Website mit der Endung <code>.i2p</code>navigiert (z.B. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Stellen Sie au\u00dferdem sicher, dass Ihr Browser so konfiguriert ist, dass er DNS-Abfragen nur \u00fcber den Proxy aufl\u00f6st, um DNS-Leaks zu vermeiden.";
    t[730] = "Updating UDP port to {0}";
