    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Die erste Zahl ist die Anzahl der Peers, mit denen Ihr Router in den letzten Minuten eine Nachricht gesendet oder empfangen hat. Dies kann je nach Gesamtbandbreite, gemeinsamer Bandbreite und lokal generiertem Datenverkehr von 8-10 bis zu mehreren hundert variieren. Die zweite Zahl ist die Anzahl der Peers, die in der letzten Stunde oder so gesehen wurden. Machen Sie sich keine Sorgen, wenn diese Zahlen stark variieren. <a href='/configstats#router.activePeers'>[Aktivieren Sie die Diagrammerstellung]</a>.";
