    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Sofern f\u00fcr den Dienst, mit dem Sie eine Verbindung herstellen m\u00f6chten, kein Ausleitserver eingerichtet wurde, ist dies nicht m\u00f6glich, mit Ausnahme von BitTorrent (siehe unten). Derzeit sind nur drei Arten von Ausleitservern aktiv: HTTP, HTTPS und E-Mail. Beachten Sie, dass derzeit kein \u00f6ffentlich gezeigter SOCKS-Ausleitserver existiert. Wenn dieser Dienst ben\u00f6tigt wird, versuchen Sie es mit <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1176] = "Destination requires encryption key";
