    t[1208] = "Watching Big Tech...";
    t[1209] = "Big Tech gucken...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Die Abweichung (Offset) der Uhrzeit Ihres Computers im Vergleich zur netzwerksynchronisierten Zeit (falls bekannt). I2P erfordert eine genaue Uhrzeit auf Ihrem Computer. Wenn die Abweichung mehr als wenige Sekunden betr\u00e4gt, korrigieren Sie das Problem bitte, indem Sie die Uhrzeit auf Ihrem Computer anpassen. Wenn I2P keine Verbindung zum Internet herstellen kann, kann eine Anzeige von 0ms angezeigt werden. Hinweis: Dies wird nur im Abschnitt <i>Router-Informationen (erweitert)</i> angezeigt. Sie k\u00f6nnen diesen Abschnitt zu Ihrer Seitenleiste auf der <a href='/configsidebar'>Seitenleisten-Konfigurationsseite</a> hinzuf\u00fcgen.";
    t[1224] = "Sort by inbound rate";
