    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "Die folgende Schwellenwertdefinition <i class=example>180/60</i> besagt, dass dasselbe entfernte Ziel w\u00e4hrend eines Zeitraums von 60 Sekunden 179 Verbindungsversuche unternommen werden k\u00f6nnen. Wenn w\u00e4hrend des gleichen Zeitraums ein weiterer Versuch unternommen wird, wird die Schwelle \u00fcberschritten und weitere Verbindungsversuche werden bis zum Ende des Zeitraums abgelehnt:";
