    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P w\u00e4hlt einen zuf\u00e4lligen Port zwischen 9000 und 31000 um mit anderen Routern zu kommunizieren wenn das Programm zum ersten Mal gestartet wird, oder wenn sich Ihre externe IP-Adresse \u00e4ndert wenn im <a href=/confignet#ipchange>Laptop-Modus</a> ausgef\u00fchrt. Der <a href=/confignet#udpconfig>gew\u00e4hlte Port</a> wird auf der <a href=/confignet>Netzwerkkonfigurationsseite</a> angezeigt.";
