    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Es dauert mindestens 10 Minuten ab dem Start Ihres Routers, bis er das Aufbauen von Teilnahme-Tunneln akzeptiert, um sicherzustellen, dass Ihr Router stabil ist und erfolgreich an das Netzwerk angeschlossen wurde.";
