    t[2247] = "Eine sanfte Einf\u00fchrung in I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Wie lange Aufgaben warten, bevor sie ausgef\u00fchrt werden. Die Aufgabenwarteschlange wird auf der <a href='/jobs'>Jobs</a>-Seite aufgelistet. Leider gibt es in dem Router mehrere andere Aufgabenwarteschlangen, die verstopft sein k\u00f6nnten, und ihr Status ist in der Router-Konsole nicht verf\u00fcgbar. Die Aufgabenverz\u00f6gerung sollte im Allgemeinen null sein. Wenn sie durchgehend h\u00f6her als 500 ms ist, ist Ihr Computer sehr langsam, Ihr Netzwerk hat Verbindungsprobleme oder der Router hat ernsthafte Probleme. <a href='/configstats#jobQueue.jobLag'>[Grafik aktivieren]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Einstellungen zur Aktualisierung";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Bevor Sie der Welt von Ihrer neuen Website erz\u00e4hlen, sollten Sie etwas Inhalt hinzuf\u00fcgen. Gehen Sie zum Server-Stammverzeichnis <a href=#rootdir>, das oben aufgef\u00fchrt ist</a>, und ersetzen Sie die Weiterleitung <i>index.html</i> mit Ihrem eigenen Inhalt. Wenn Sie eine Vorlage f\u00fcr eine einfache Webseite ben\u00f6tigen, k\u00f6nnen Sie gerne <a href=http://127.0.0.1:7658/help/pagetemplate.html>diese Seite</a> anpassen. Wenn Sie nach der Bearbeitung des Inhalts auf diese Seite zur\u00fcckkehren, versuchen Sie, den Webcache Ihres Browsers zu leeren.";
