    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Wenn Ihr Router 10 oder mehr aktive Peers hat, ist alles in Ordnung. Der Router sollte jederzeit Verbindungen zu einigen Peers aufrechterhalten. Die beste M\u00f6glichkeit, eine bessere Verbindung zum Netzwerk herzustellen, besteht darin, <a href=/config>mehr Bandbreite zu teilen</a>.";
