    t[2371] = "Glossar";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Um einen eigenen Hostnamen zu erhalten, bieten I2P-Domain-Registrare wie <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> oder <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> Registrierungsdienste an, die es Ihnen erm\u00f6glichen, einen .i2p-Hostname oder Sub-Domain zu registrieren und zu verwalten, der dann im Netzwerk verbreitet wird. Einige Registrierungsseiten erfordern die Angabe der <i>B64-Zieladresse</i> f\u00fcr den Tunnel/Service, den Sie mit einem Hostnamen verkn\u00fcpfen m\u00f6chten. Diese Adresse sollten Sie aus dem Abschnitt <i>Lokales Ziel</i> auf der <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurationsseite des Tunnel-Managers</a> kopieren.";
