    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Dies zeigt die Menge an RAM an, die I2P verwendet, sowie die insgesamt verf\u00fcgbare Menge, die von Java zugewiesen wird. Wenn die Nutzung im Verh\u00e4ltnis zum verf\u00fcgbaren RAM dauerhaft hoch ist, kann dies darauf hinweisen, dass Sie den f\u00fcr die JVM zugewiesenen RAM erh\u00f6hen m\u00fcssen. Sie k\u00f6nnen mehr RAM zuweisen, indem Sie Ihre <code>wrapper.config</code> -Datei bearbeiten, die normalerweise im I2P-Anwendungsverzeichnis liegt. Sie m\u00fcssen den <code>wrapper.java.maxmemory</code> Parameter bearbeiten, der standardm\u00e4\u00dfig auf 256 (MB) f\u00fcr I2P oder 384 f\u00fcr I2P+ festgelegt ist. Hinweis: Wenn die Speicherleiste aktiviert ist, wird der Speichereintrag im Router-Info-Abschnitt unterdr\u00fcckt.";
