    t[2531] = "ein-/ausgehend";
    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "W\u00e4hlen Sie unter <i>Proxyzugriff auf das Internet konfigurieren</i> die Option <i>Manuelle Proxy-Konfiguration</i> aus.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Um Ihren eigenen statischen Inhalt bereitzustellen, m\u00fcssen Sie nur die Dateien im Stammverzeichnis des Webservers bearbeiten oder ersetzen, und die Website wird nach Befolgung der unten stehenden Anweisungen im I2P-Netzwerk verf\u00fcgbar sein. Dar\u00fcber hinaus k\u00f6nnen CGI- und Python-Skripte aus dem Verzeichnis <code>cgi-bin</code> direkt \u00fcber <code>docroot</code> ausgef\u00fchrt werden, wenn Sie <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>Perl</a> und <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>Python</a> installiert haben.";
