    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Viele der Statistiken in der Seitenleiste k\u00f6nnen <a href='/configstats'>konfiguriert</a> werden, um <a href='/graphs'>grafisch dargestellt</a> zu werden, um weitere Analysen durchzuf\u00fchren. Sie k\u00f6nnen auch die Abschnitte anpassen, die in der Seitenleiste angezeigt werden, sowie deren Position auf der <a href='/configsidebar'>Seitenleistenkonfigurationsseite</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Diese tunnelbezogene Einstellung erm\u00f6glicht Ihnen, Antworten auf an Server des Routers gesendete Pings zu aktivieren oder zu deaktivieren. Um Pings zu deaktivieren, m\u00fcssen Sie die Zeile <code>i2p.streaming.answerPings=false</code> dem Abschnitt <i>Benutzerdefinierte Optionen</i> der Serverkonfiguration im Tunnel-Manager hinzuf\u00fcgen.";
    t[2592] = "Max";
    t[2593] = "Max";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Wenn Sie nicht signierte (.zip) I2P-Updates installieren m\u00f6chten, sollte dies Ihrer Datei <code>router.config</code> hinzugef\u00fcgt werden, es sei denn Sie haben bereits <code>routerconsole.advanced=true</code> konfiguriert, in welchem Fall diese Option bereits vorgesehen ist. Hinweis: Ab I2P+ 0.9.48+ ist die Installation von <a href=/configupdate#i2pupdates>nicht signierten Updates</a> standardm\u00e4\u00dfig aktiviert.";
