    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Wenn Sie jemanden kennen und vertrauen, der I2P betreibt, bitten Sie ihn, Ihnen eine Neusaatdatei zu senden, die mithilfe dieser Seite in seiner Router-Konsole generiert wurde. W\u00e4hlen Sie dann auf {0} die Option <i>Neu auss\u00e4en aus Datei</i> mit der empfangenen Datei.";
