    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Diese Einstellung (in Sekunden) erm\u00f6glicht es Ihnen, die Verz\u00f6gerung zwischen den L\u00e4ufen des Peer-Exploration-Jobs zu \u00fcberschreiben, der versucht, neue Peers zum Hinzuf\u00fcgen zum NetzDB zu finden. Der Job l\u00e4uft standardm\u00e4\u00dfig alle 80 Sekunden oder, falls der Router Job- oder Nachrichtenverz\u00f6gerungen aufweist, alle 3 Minuten. Wenn die Gr\u00f6\u00dfe des NetzDB 4000 Peers erreicht, erh\u00f6ht sich die Pause auf 15 Minuten. Sie m\u00f6chten die Verz\u00f6gerung m\u00f6glicherweise erh\u00f6hen, wenn Ihr NetzDB gut gef\u00fcllt ist (\u00fcber 2000 Peers), oder wenn Sie die Gesamtbandbreitennutzung reduzieren m\u00f6chten. Hinweis: F\u00fcr Flutverst\u00e4rker-Router l\u00e4uft dieser Job nicht.";
    t[2698] = "Current";
    t[2699] = "Aktuell";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Eine im I2P-Netzwerk gehostete Website. Standardm\u00e4\u00dfig ist ein <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-Webserver</a> konfiguriert und l\u00e4uft auf <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
