    t[2755] = "Hier k\u00f6nnen Sie eine neue Routerfamilie erstellen. Sobald Sie die Familie erstellt haben, k\u00f6nnen Sie die Familienschl\u00fcsseldatei exportieren und mit anderen Routern in Ihrer nominierten Familie teilen.";
