    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Um auf Websites zuzugreifen, die auf I2P gehostet sind, und optional den Standard-Outproxy zum Verbinden mit Websites im Clearnet zu verwenden, m\u00fcssen Sie Ihren Browser so konfigurieren, dass er den I2P-HTTP-Proxy verwendet, der standardm\u00e4\u00dfig auf <code>127.0.0.1 Port 4444</code> l\u00e4uft. Die meisten Browser bieten eine Option zur Konfiguration des Proxys; in diesem Minitutorial werden wir uns auf Firefox konzentrieren.";
    t[2776] = "Close to us";
