    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ funktioniert am besten, wenn Sie die Geschwindigkeit Ihrer Netzwerkverbindung im Abschnitt <a href=/config>Bandbreitenkonfiguration</a> genau angeben k\u00f6nnen. Standardm\u00e4\u00dfig ist I2P+ mit einigen eher konservativen Werten konfiguriert, die f\u00fcr viele Anwendungsf\u00e4lle nicht geeignet sind. Nehmen Sie sich daher bitte die Zeit, diese Einstellungen zu \u00fcberpr\u00fcfen und gegebenenfalls zu korrigieren. Je mehr Bandbreite Sie <i>insbesondere</i> Upstream-Bandbreite zuweisen, desto mehr profitieren Sie vom Netzwerk.";
