    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Das I2P Network Protocol (I2NP) verwaltet die Routenf\u00fchrung und Vermischung von Nachrichten zwischen den Routern sowie die Auswahl des Transportmittels (wenn mehr als eines unterst\u00fctzt wird) bei der Kommunikation mit einem Peer. Weitere Informationen finden Sie in der <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Wurde vor {0} ung\u00fcltig";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Der Status Ihres Routers, ob er Anfragen von anderen Routern akzeptiert oder ablehnt, um einen Teilnahme-Tunnel durch Ihren Router aufzubauen. Ihr Router kann alle Anfragen akzeptieren, einen Prozentsatz der Anfragen akzeptieren oder ablehnen oder aus verschiedenen Gr\u00fcnden alle Anfragen ablehnen, um die Bandbreite und CPU-Anforderungen zu steuern und die Kapazit\u00e4t f\u00fcr lokale Clients aufrechtzuerhalten. <b>Hinweis";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Bitte kontaktieren Sie einen bekannten vertrauensw\u00fcrdigen Freund, der einen laufenden I2P-Router hat, und bitten Sie ihn um Hilfe beim Reseeden Ihres I2P-Routers. Fordern Sie ihn auf, Ihnen eine Reseed-Datei zu schicken, die aus ihrem laufenden I2P-Router exportiert wurde. Es ist entscheidend, dass die Datei \u00fcber einen sicheren Kanal ausgetauscht wird, z.B. verschl\u00fcsselt, um externe Manipulationen zu vermeiden (PGP signiert, verschl\u00fcsselt und mit einem vertrauensw\u00fcrdigen \u00f6ffentlichen Schl\u00fcssel verifiziert). Die Datei selbst ist nicht signiert, daher akzeptieren Sie bitte nur Dateien von bekannten vertrauensw\u00fcrdigen Freunden. Importieren Sie niemals eine Reseed-Datei, wenn Sie ihre Quelle nicht \u00fcberpr\u00fcfen k\u00f6nnen.";
    t[2916] = "Last Good Send";
