    t[2921] = "Sie k\u00f6nnen einen Recorder in einem Tunnel verwenden, der in eine Datei schreibt, die ein anderer Tunnel oder mehrere Tunnel zum Drosseln verwenden kann. Diese Dateien k\u00f6nnen auch manuell bearbeitet werden.";
