    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Unten genannte Java-Anwendungen werden vom WebKonsolen-Client gestartet und laufen in der selben JVM wie der Router. Es handelt sich dabei normalerweise Web-Anwendungen, die \u00fcber die Routerkonsole erreichbar sind. Es k\u00f6nnen komplette Anwendungen (z.B. i2psnark), reine Oberfl\u00e4chen f\u00fcr andere Clients, Anwendungen, die separat aktiviert werden m\u00fcssen (z.B. susidns, i2ptunnel), oder Anwendungen ohne Oberfl\u00e4che (Adressbuch) sein.";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "WARNUNG \u2013 Eingehende 0-Hop-Tunnel werden f\u00fcr versteckte Router nicht empfohlen.";
