    t[2973] = "HTTP-Proxy";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Dies ist die Gesamtanzahl der Peers, die Ihr Router kennt. Sie werden auf der <a href='/netdb'>Netzwerkdatenbankseite</a> aufgelistet. Dies kann von weniger als 100 bis zu 1000 oder mehr reichen. Diese Zahl ist nicht die Gesamtgr\u00f6\u00dfe des Netzwerks; sie kann stark variieren, abh\u00e4ngig von Ihrer Gesamtbandbreite, gemeinsamen Bandbreite und lokal generiertem Verkehr. I2P erfordert nicht, dass ein Router jeden anderen Router im Netzwerk kennt.";
