    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Sie k\u00f6nnen das <a href=http://127.0.0.1:7658/help/images/>Standarderscheinungsbild</a> des Verzeichnislisten \u00fcberschreiben, indem Sie eine bearbeitete <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a>-Datei bereitstellen, um ein globales Erscheinungsbild festzulegen. Beachten Sie, dass diese Datei nicht in der Verzeichnisliste des Webservers angezeigt wird. Dateien und Verzeichnisse mit einem . als Pr\u00e4fix sowie Dateien mit dem Namen favicon.ico oder Dateien, die mit ~ oder .bak oder .old enden, werden ebenfalls ausgeblendet (obwohl weiterhin zug\u00e4nglich). Hinweis: Um auf Windows versteckte Dateien mit einem . als Pr\u00e4fix zu erstellen, f\u00fcgen Sie ein abschlie\u00dfendes . zu der Datei oder dem Verzeichnis hinzu, z.B. <code>.hidden.</code>; Der Windows Explorer speichert die Datei dann unter dem korrekten Namen und entfernt dabei den abschlie\u00dfenden Punkt.";
