    t[3161] = "Dies ist eine gek\u00fcrzte Version der offiziellen FAQ. F\u00fcr die vollst\u00e4ndige Version besuchen Sie bitte <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> oder <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
