    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Wenn auf \u201etrue\u201c gesetzt, werden zus\u00e4tzliche Funktionen in der Konsole aktiviert und der Benutzer kann Einstellungen direkt auf der <a href=/configadvanced>Seite f\u00fcr erweiterte Konfiguration</a> bearbeiten. Es stehen zus\u00e4tzliche Anzeigeoptionen im Abschnitt <a href=/netdb>Datenbank des Netzwerks</a> zur Verf\u00fcgung, einschlie\u00dflich des <a href='/netdb?f=3'>Werkzeugs zur Sybil-Analyse</a>, und es gibt zus\u00e4tzliche Konfigurationsoptionen auf der <a href=/configclients>Seite f\u00fcr Client-Konfiguration</a>. Au\u00dferdem wird die Installation nicht signierter Updates, die manuelle Konfiguration der News-URL und zus\u00e4tzliche Seitenbereiche aktiviert.";
