    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "Dies ist ein experimentelles Netzwerkdatenbanktool zum Debuggen und Analysieren. Geraten Sie nicht in Panik, auch wenn Sie Warnhinweise sehen. M\u00f6gliche \u201eBedrohungen\u201c werden zusammengefasst, es handelt sich jedoch wahrscheinlich nicht um echte Bedrohungen. Wenn Sie etwas sehen, das Sie mit den Entwicklern besprechen m\u00f6chten, kontaktieren Sie uns im IRC #i2p-dev.";
