    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "Eine Abspaltung des <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent-Client</a>, der f\u00fcr die Verwendung im I2P-Netzwerk umstrukturiert wurde. Normalerweise als Teil der Standard-Anwendungssammlung mit Java I2P bereitgestellt und auch als <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>eigenst\u00e4ndige Java-Anwendung</a> verf\u00fcgbar.";
