    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Dies ist die Anzahl der Peers, die Ihr Router zum Aufbau von Client-Tunneln zur Verf\u00fcgung hat. Dies liegt normalerweise im Bereich von 8-30. Ihre schnellen Peers werden auf der <a href='/profiles'>Profilseite</a> angezeigt. <a href='/configstats#router.fastPeers'>[Aktivieren Sie die Diagrammerstellung]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Klicken Sie auf die Schaltfl\u00e4che <i>Reseed von Datei</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Eine Variante des Zwiebel-Routings, die mehrere Nachrichten zusammen verschl\u00fcsselt, um es Angreifern zu erschweren, Verkehrsanalysen durchzuf\u00fchren und die Geschwindigkeit der Daten\u00fcbertragung zu erh\u00f6hen. Weitere Informationen finden Sie in der <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "So h\u00e4rten Sie Ihre WordPress-Site ab";
    t[3496] = "I2P Internals";
    t[3497] = "Einstellungen";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Standardm\u00e4\u00dfig wird I2P mit einem Webserver geliefert, um Ihre eigene anonymisierte Website (traditionell als <i>eepsite</i> bezeichnet) zu hosten. Sowohl die Website als auch die I2P-Routerkonsole werden auf einer optimierten Version von <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a> ausgef\u00fchrt, die f\u00fcr I2P angepasst wurde.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Diese Einstellung erlaubt es Ihnen, \u00e4ltere Router von Ihrem NetzDB auszuschlie\u00dfen. Router, die \u00e4lter sind als der Standardwert oder der von Ihnen gesetzte Wert, werden aus dem NetzDB gel\u00f6scht und f\u00fcr die Dauer der Router-Sitzung gesperrt. Standardm\u00e4\u00dfig werden Router ausgeschlossen, die \u00e4lter sind als 0.9.20. Hinweis: Ab I2P+ Version 0.9.46 werden nur Router mit sehr aktuellen Versionen zum Aufbau lokaler Tunnel verwendet. [Neustart erforderlich]";
