    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Diese Einstellung \u00fcberschreibt in Millisekunden die Standard-Nachrichtenverarbeitungszeitgrenze (angezeigt als <i>Nachrichtenverz\u00f6gerung</i> im Bereich Stau der Seitenleiste), bevor der Router als \u00fcberlastet eingestuft und Anfragen f\u00fcr Transit-Tunnels abgewiesen werden. [Standard ist 750ms oder 1500ms, wenn der Router als langsam markiert ist]";
