    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "Ausgehender UDP-Verkehr auf Port 123, mit Erlaubnis f\u00fcr Antworten: Dies ist notwendig f\u00fcr die interne Zeitabgleichung von I2P (\u00fcber SNTP - Befragung eines zuf\u00e4lligen SNTP-Hosts in <code>pool.ntp.org</code> oder eines <a href=/help/advancedsettings#ntpserverconfig>anderen von Ihnen angegebenen Servers</a>).";
