    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Benutzer eines XChat-\u00e4hnlichen Clients k\u00f6nnen ein neues Netzwerk mit dem Server <code>127.0.0.1/6668</code> erstellen (den Haken bei <i>Proxy-Server umgehen</i> setzen, falls ein Proxy konfiguriert ist), oder k\u00f6nnen sich mit dem Befehl <code>/server 127.0.0.1 6668</code> verbinden. Die Syntax kann bei verschiedenen IRC-Clients variieren.";
