    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Die nachfolgend aufgef\u00fchrten Router-Konfigurationsoptionen sind in der Benutzeroberfl\u00e4che normalerweise nicht verf\u00fcgbar, da sie selten genutzt werden oder den Zugriff auf erweiterte Einstellungen erm\u00f6glichen, die die meisten Benutzer nicht ben\u00f6tigen. Dies ist keine vollst\u00e4ndige Liste. Einige Einstellungen erfordern einen Neustart des Routers, um wirksam zu werden. Beachten Sie, dass alle Einstellungen gro\u00df- und kleinschreibempfindlich sind. Sie m\u00fcssen die Datei <code>router.config</code> bearbeiten, um Optionen hinzuzuf\u00fcgen oder, nachdem Sie <code>routerconsole.advanced=true</code> zur Datei router.config hinzugef\u00fcgt haben, k\u00f6nnen Sie die Einstellungen innerhalb der Konsole auf der <a href=/configadvanced>Seite f\u00fcr erweiterte Konfiguration</a> bearbeiten.";
