    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Bei einigen IRC-Clients ist eingestellt, dass sie sich vom Server trennen, wenn eine bestimmte Zeitlang keine Kommunikation mit dem Server stattfand, was bei I2P IRC manchmal problematisch sein kann, wenn der <i>Ping-Timeout</i>-Wert zu niedrig eingestellt ist. Wenn Sie in Ihrem Client den Ping-Timeout-Wert auf einen hohen Wert setzen (z.B. 320 Sekunden), resultiert das h\u00e4ufig in einer stabileren Verbindung zum Netzwerk. In Hexchat k\u00f6nnen Sie den Wert eingeben durch <code>/set net_ping_timeout 320</code>. Dieser Wert wird dann in Ihre Datei <code>hexchat.conf</code> geschrieben.";
    t[3964] = "Run at Startup?";
    t[3965] = "Beim Starten des Systems mitstarten?";
