    t[3973] = "Nie";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Eine <a href=/confignet#ipchange>optionale Konfiguration</a>, die Ihre <a href=/netdb?r=.>Router-Identit\u00e4t</a> und <a href=/confignet#udpconfig>externen Port</a> automatisch \u00e4ndert, wenn sich die \u00f6ffentliche IP-Adresse Ihres Systems \u00e4ndert. Dadurch kann verhindert werden, dass ein Angreifer Ihre Router-Identit\u00e4t und IP-Adresse in Szenarien korreliert, in denen Ihre IP-Adresse h\u00e4ufig wechseln kann, z. B. wenn Sie I2P auf einem Laptop an verschiedenen Standorten ausf\u00fchren.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Die Einstellungen des Routers verhindern die Ver\u00f6ffentlichung der Adresse, deswegen akzeptiert er keine eingehenden Verbindungen.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Eine mit I2P+ (Linux/MacOS) gelieferte Befehlszeilenanwendung, die verwendet wird, um einen <code>head</code>-Anfrage an eine angegebene HTTP-Ressource im Netzwerk durchzuf\u00fchren und verschiedene Antwortheader vom Remote-Server zur\u00fcckzugeben. Standardm\u00e4\u00dfig verwendet eephead den HTTP-Proxy auf <code>127.0.0.1:4444</code>.";
