    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Um auf Websites im I2P-Netzwerk zuzugreifen und optional den Standard-Outproxy zum Verbinden mit Websites auf dem Clearnet zu verwenden, m\u00fcssen Sie Ihren Browser so konfigurieren, dass der I2P+ <b>HTTP</b>-Proxy verwendet wird, der standardm\u00e4\u00dfig unter <code>127.0.0.1 Port 4444</code> l\u00e4uft. F\u00fcr weitere Hilfe siehe <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>den Konfigurationsleitfaden</a> oder <a href=/help/configuration#browserconfig>das Mini-Tutorial f\u00fcr Firefox</a>.";
