    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Hinweis: Die Reihenfolge der Deklarationen ist wichtig. Die erste Schwellenwertdeklaration f\u00fcr ein bestimmtes Ziel (ob explizit oder in einer referenzierten Datei aufgelistet) \u00fcberschreibt alle zuk\u00fcnftigen Schwellenwerte f\u00fcr dasselbe Ziel, ob explizit oder in einer Datei aufgelistet. Hinweis: Um eine neue Filterdatei anzuwenden, muss der Tunnel nach der Angabe des Speicherorts im Tunnelmanager neu gestartet werden. Nach der Konfiguration kann eine Definitiondatei aktualisiert werden, ohne dass der Zieltunnel neu gestartet werden muss, obwohl blockierte Ziele solange bestehen bleiben, bis der Tunnel neu gestartet wird.";
