    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Hinweis:</b> Bei einigen Apache-Installationen sind die <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a>- und <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a>-Module standardm\u00e4\u00dfig aktiviert. Es ist wichtig, diese zu deaktivieren oder anderweitig den Zugriff auf die URLs zu sch\u00fctzen, um die Anonymit\u00e4t und Sicherheit Ihres Servers nicht zu gef\u00e4hrden.";
