    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "Die Version der ausgef\u00fchrten I2P-Software. Wenn eine neue Version verf\u00fcgbar ist, werden Sie in der Seitenleiste benachrichtigt. Es wird empfohlen, Ihren Router auf dem neuesten Stand zu halten, um eine optimale Leistung und Sicherheit zu gew\u00e4hrleisten. Router-Updates werden in der Regel im Durchschnitt alle 2-3 Monate bereitgestellt.";
