    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-basiertes TCP) und NTCP2 sind TCP-basierte Netzwerktransports, die Javas NIO (New I/O) TCP-Implementierung verwenden, um I2NP-Nachrichten zwischen Routern im Netzwerk zu \u00fcbermitteln. NTCP2 verbessert die Widerstandsf\u00e4higkeit von NTCP gegen verschiedene Angriffe und automatisierte Verkehrsidentifikationsmethoden. Weitere Informationen finden Sie in der <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Sie k\u00f6nnen einen Recorder verwenden, um die Ziele von aggressiven Clients in eine angegebene Datei zu protokollieren und dann dieselbe Datei verwenden, um sie zu drosseln. Der folgende Ausschnitt definiert einen Filter, der zun\u00e4chst alle Verbindungsanfragen zul\u00e4sst, aber wenn ein einzelnes Ziel 180 Anfragen in 60 Sekunden \u00fcberschreitet, wird es alle 60 Sekunden auf 30 Anfragen gedrosselt:";
