    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "Beachten Sie, dass ein schlecht konfigurierter Webserver oder eine schlecht konfigurierte Webanwendung Informationen wie Ihre echte IP-Adresse oder Serverdetails preisgeben kann, was Ihre Anonymit\u00e4t verringern oder einem Hacker helfen kann. Wenn Sie eine alternative Plattform verwenden, stellen Sie sicher, dass sie vor der Ver\u00f6ffentlichung im Internet gesichert ist. Bei Unsicherheit konsultieren Sie Online-Ratgeber zum H\u00e4rten von Webservern und Webanwendungen, zum Beispiel:";
