    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ unterst\u00fctzt benutzerdefinierte Themen\u00fcberschreibungen f\u00fcr die Konsole, den Tunnel-Manager, I2PSnark, SusiDNS und Susimail, die \u00c4nderungen an den Themen erm\u00f6glichen, die nach Upgrades bestehen bleiben. Um eine \u00dcberschreibung zu aktivieren, erstellen Sie eine CSS-Datei mit dem Namen <code>override.css</code> mit Ihren Themen\u00e4nderungen und platzieren Sie sie im relevanten Themenverzeichnis des Themas, das Sie \u00e4ndern m\u00f6chten, oder benennen Sie eine der Beispieldateien um und aktualisieren Sie dann den Browser neu. Beachten Sie, dass der Tunnel-Manager und die Konsole die gleiche override.css-Datei verwenden. Um eine \u00dcberschreibung zu deaktivieren, l\u00f6schen oder benennen Sie die Datei <code>override.css</code> um und aktualisieren Sie dann den Browser neu (normalerweise Strg + Umschalt + R).";
