    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Wenn Ihr Router nach einigen Minuten Betriebszeit 0 aktive Peers und 0 bekannte Peers anzeigt und in der Seitenleiste eine Benachrichtigung erscheint, dass Sie Ihre Netzwerkverbindung \u00fcberpr\u00fcfen m\u00fcssen, \u00fcberpr\u00fcfen Sie zun\u00e4chst, ob Sie auf das Internet zugreifen k\u00f6nnen. Wenn Ihre Internetverbindung funktioniert, m\u00fcssen Sie m\u00f6glicherweise Java in Ihrer Firewall freigeben. Andernfalls m\u00fcssen Sie Ihren I2P-Router erneut auff\u00fcllen. Besuchen Sie die Seite <a href=/configreseed#reseedconfig>Reseed-Konfiguration</a> und klicken Sie auf die Schaltfl\u00e4che <i>\u00c4nderungen speichern und jetzt neu auff\u00fcllen</i>. Weitere Informationen finden Sie im obigen Abschnitt <a href=#reseedhelp>Reseed-Hilfe</a>.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Eine h\u00f6here Socket-API f\u00fcr Clients. Wird nur ge\u00f6ffnet wenn ein SAM V3 Client eine UDP-Sitzung anfordert. Kann auf der <a href=/configclients>Client-Konfigurationsseite</a> aktiviert/deaktiviert werden. Kann in der Datei <code>clients.config</code> mit der SAM Befehlszeilenoption <code>sam.udp.port=nnnn</code> ge\u00e4ndert werden.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Wenn Sie m\u00f6chten, dass Ihre Website reaktionsschnell ist, ist die Bildkompression beim Hosten gro\u00dfer Bilder unerl\u00e4sslich. Die Verwendung eines Dienstes wie <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> zur Komprimierung Ihrer PNG- und JPEG-Bilder f\u00fchrt h\u00e4ufig zu viel kleineren Dateien mit nur minimalen Qualit\u00e4tsverlusten. In einigen Situationen kann das WebP-Format JPEGs \u00fcbertreffen und kleinere Dateien mit ungef\u00e4hr der gleichen oder besserer visueller Genauigkeit generieren und wird von vielen Browsern unterst\u00fctzt. Denken Sie auch dar\u00fcber nach, SVGs anstelle von Bitmaps f\u00fcr Symbole und Illustrationen zu verwenden - sie sind oft kleiner als die entsprechende Bitmap-Datei (f\u00fchren Sie sie durch einen Dienst wie <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a>, um nicht ben\u00f6tigte Daten zu entfernen), skalieren ohne Qualit\u00e4tsverlust und k\u00f6nnen von Ihrem Webserver gzipped werden.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP ist f\u00fcr dieses Ger\u00e4t deaktiviert";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Standardm\u00e4\u00dfig teilen die meisten Ihrer Client-Dienste (E-Mail, HTTP-Proxy, IRC) denselben Satz von Tunneln (aus Leistungsgr\u00fcnden) und werden in der Seitenleiste unter Service-Tunnel als <i>Gemeinsam genutzte Clients</i> und <i>Gemeinsam genutzte Clients (DSA)</i> aufgef\u00fchrt und auf der <a href=/tunnels>Tunnelseite</a> angezeigt.";
