    t[5685] = "\u00dcberpr\u00fcfen Sie, ob ein anderes Programm den eingestellten Port benutzt. Falls ja, beenden Sie dieses Programm oder w\u00e4hlen Sie einen anderen Port f\u00fcr I2P!";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Peers manuell bearbeiten und gesperrte Peers und Sperrliste anzeigen";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewalled mit aktiviertem eingehendem TCP";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "\u00d6ffnen Sie <a href=/confignet#udpconfig>I2P+-Port</a> auf Ihrem Modem, Router und/oder Firewall(s) f\u00fcr eine bessere Konnektivit\u00e4t (idealerweise sowohl UDP als auch TCP). Weitere Informationen zur Portweiterleitung finden Sie unter <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a> sowie in unseren Foren und IRC-Kan\u00e4len. Beachten Sie, dass I2P keine Verbindung zum Internet \u00fcber einen http- oder Socks-Proxy unterst\u00fctzt [Patches willkommen!]. Sie k\u00f6nnen jedoch \u00fcber I2P selbst auf Proxies zugreifen, sobald Sie mit dem Netzwerk verbunden sind.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Ein Tunnel-Filter kann Schutz vor Denial-of-Service-Angriffen bieten, ohne den Service f\u00fcr echte Benutzer anderweitig zu unterbrechen, entweder in Verbindung mit dem Tunnel-Verz\u00f6gere oder als alternative Strategie. Er kann auch verwendet werden, um den Zugriff auf einen gehosteten Dienst zu protokollieren, um festzustellen, ob der Server angegriffen wird, oder um einfach alle Besucher nach I2P-Ziel zu protokollieren. Ein Filter kann gleichzeitig als Whitelist und Blacklist fungieren und ist dadurch flexibler als die Zugriffslistensteuerungen des Tunnel Managers. Beachte, dass mehrere Server-Tunnel eine einzige Filterdatei verwenden k\u00f6nnen, wenn du eine globale Filterung implementieren m\u00f6chtest.";
