    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Diese Einstellung (in Millisekunden) erm\u00f6glicht das manuelle Konfigurieren der Verz\u00f6gerung zwischen Routenaktualisierungen durchgef\u00fchrt vom Refresh Routers Job. Standardm\u00e4\u00dfig wird die Pause zwischen Aktualisierungen durch die Gr\u00f6\u00dfe des NetzDBs bestimmt und f\u00fchrt eine zeitliche Randomisierung ein, um Traffic-Analysen entgegenzuwirken. Bei Werten unter 2000 Millisekunden wird empfohlen, den Wert von <code>router.refreshTimeout</code> zu erh\u00f6hen. Beachten Sie, dass Werte darunter 2000 Millisekunden die Netzwerkauslastung erh\u00f6hen und Job-Verz\u00f6gerungen hervorrufen k\u00f6nnen, und f\u00fcr einen l\u00e4ngerfristigen Gebrauch nicht empfohlen werden.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Servertunnel, die im <a href=/i2ptunnelmgr>Tunnel Manager</a> konfigurierbar sind, bieten verschiedene M\u00f6glichkeiten, den Zugriff auf den gehosteten Dienst zu beschr\u00e4nken. Ziel-Whitelisting, Blacklisting, Verbindungsverz\u00f6gerung und Tunnel-Filterung sind Methoden, die bereitgestellt werden, um Denial-of-Service-Angriffe zu verhindern, exklusiven Zugriff auf bekannte I2P-Ziele zu gew\u00e4hren und den Verkehr zum Server zu verwalten.";
