    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Geben Sie diese Datei nicht an unbekannte Benutzer weiter, da sie sensible Daten (100 RouterInfo-Dateien) von Ihrem eigenen I2P-Router enth\u00e4lt, die potenziell von einem Gegner verwendet werden k\u00f6nnten, um Ihre Identit\u00e4t aufzudecken. Um Ihre Anonymit\u00e4t zu sch\u00fctzen, sollten Sie einige Stunden/Tage warten, bevor Sie die Datei mit Ihrem vertrauensw\u00fcrdigen Freund teilen. Es ist auch ratsam, dieses Verfahren sparsam zu verwenden (nicht \u00f6fter als einmal pro Woche).";
