    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "Der Akt des Beitragens zum Netzwerk, indem es anderen Routern erm\u00f6glicht wird, Tunnel mit Ihrem Router in einer Tunnelkette zu erstellen. Mindestens 12 KB/s Upload-Bandbreite (Netzwerkanteil) muss zugewiesen werden, um die Teilnahme zu erm\u00f6glichen. Beachten Sie, dass Firewalled-Router in ihrem Beitrag zur Teilnahme eingeschr\u00e4nkt sind und ein als Hidden bezeichneter Router \u00fcberhaupt nicht teilnimmt.";
