    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Hinweis: Um Ihre Sicherheit beim Surfen auf .i2p-Websites zu erh\u00f6hen, sollten Sie in Betracht ziehen, ein Addon zu installieren, das das Ausf\u00fchren von Javascript im Browser verhindert, wie z.B. <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>. Es wird jedoch empfohlen, die Adresse, auf der I2P+ ausgef\u00fchrt wird, zur Whitelist hinzuzuf\u00fcgen, um verschiedene Verbesserungen der Routerkonsole zu erm\u00f6glichen. Dar\u00fcber hinaus wird auch ein Addon empfohlen, das Anfragen an externe Ressourcen verhindert, wie z.B. <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
