    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "Beim ersten Start von I2P+ kann es Zeit ben\u00f6tigen, bis es sich in das Netzwerk integriert und zus\u00e4tzliche Knoten erkennt. Je l\u00e4nger Ihr I2P+ Router l\u00e4uft, desto besser wird seine Leistung, daher versuchen Sie, Ihren Router so lange wie m\u00f6glich eingeschaltet zu lassen, wenn m\u00f6glich 24/7! Wenn nach 30 Minuten die Anzahl Ihrer <i>Aktiv: [verbunden/neu]</i> Knoten immer noch weniger als 10 betr\u00e4gt oder die Gesamtzahl Ihrer <i>Integrierten</i> Knoten weniger als 5 betr\u00e4gt, gibt es einige Dinge, die Sie \u00fcberpr\u00fcfen k\u00f6nnen, um Probleme zu erkennen:";
