    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Eine Java-Implementierung eines Tor-Clients, die als I2P-Plugin verf\u00fcgbar ist. Kann als Standard-<i>Outproxy</i> verwendet werden, wenn es in einem relevanten SOCKS- oder HTTP-Client-Tunnel im <i>Tunnel Manager</i> konfiguriert ist. Verf\u00fcgbar unter <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Der Quellcode ist auf <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a> verf\u00fcgbar.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4-Adressen";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Dieser Abschnitt zeigt Ihre durchschnittlichen Bandbreitengeschwindigkeiten und die Gesamtnutzung f\u00fcr die Sitzung an. Alle Werte sind in Bytes pro Sekunde angegeben. Sie k\u00f6nnen Ihre Bandbreitsgrenzen auf der <a href='/config'>Bandbreitskonfigurationsseite</a> \u00e4ndern. Je mehr Bandbreite Sie zur Verf\u00fcgung stellen, desto mehr helfen Sie dem Netzwerk und verbessern Ihre eigene Anonymit\u00e4t, daher nehmen Sie sich bitte die Zeit, um die Einstellungen zu \u00fcberpr\u00fcfen. Wenn Sie sich \u00fcber die Geschwindigkeit Ihres Netzwerks nicht sicher sind, k\u00f6nnen Sie einen Dienst wie <a href='http://speedtest.net/'>SpeedTest</a> oder \u00e4hnliches verwenden, um eine gute Einsch\u00e4tzung Ihrer Bandbreitenf\u00e4higkeiten zu erhalten. Die Menge Ihres Uploads (KBps Out) bestimmt Ihren Gesamtbeitrag zum Netzwerk. Die Bandbreite wird standardm\u00e4\u00dfig <a href='/graphs'>grafisch dargestellt</a>.";
