    t[7023] = "Diese Einstellung (in Millisekunden) erm\u00f6glicht die manuelle Konfiguration des Zielverz\u00f6gerungswerts f\u00fcr die Warteschlangenverwaltung durch CoDel. Standardm\u00e4\u00dfig sind es 50 ms. [Neustart erforderlich]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
