    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P funktioniert hinter diesem Typ Firewall nicht gut. Sie k\u00f6nnen wahrscheinlich keine eingehenden Verbindungen akzeptieren, was Ihre Teilnahme am Netzwerk beeintr\u00e4chtigt.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Das I2P Client Protocol (I2CP) erm\u00f6glicht externen Anwendungen (Clients) die Kommunikation mit I2P \u00fcber einen einzelnen TCP-Socket, standardm\u00e4\u00dfig \u00fcber Port 7654. Weitere Informationen finden Sie in der <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Gesamtsummen der Warteschlange";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Diese Einstellung bestimmt, welcher Transport bei der Kommunikation mit Peers Vorrang hat. Standardm\u00e4\u00dfig hat NTCP Vorrang vor UDP (SSU). Wenn der Wert auf true gesetzt wird, wird UDP bevorzugt, es sei denn, eine bestehende NTCP-Verbindung existiert; bei immer wird immer UDP unabh\u00e4ngig von einer vorhandenen NTCP-Verbindung verwendet. [Standardm\u00e4\u00dfig ist false]";
