    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "Die Daten werden \u00fcber jeweils 1 Minute erhoben und repr\u00e4sentieren daher nur eine N\u00e4herung.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Wird auf true gesetzt, l\u00e4uft I2P ohne Netzwerkanbindung, was hilfreich ist, wenn der Router st\u00e4ndig neu gestartet wird, um Code-Updates zu testen, da dies Netzwerkunterbrechungen verhindert.";
    t[7302] = "Updating IP address";
