    t[7429] = "Diese Einstellung (in Stunden) bestimmt, wie alt ein RouterInfo im NetzDB sein darf (basierend auf seinem letzten bekannten Ver\u00f6ffentlichungsdatum), bevor es als veraltet eingestuft und gel\u00f6scht wird. [Standardm\u00e4\u00dfig sind es 28 Stunden, es sei denn der Router ist ein Flutverst\u00e4rker, dann sind es 8 Stunden.]";
