    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Wenn eine <i>Registrierungsauthentifizierung</i>-Zeichenkette angefordert wird, finden Sie diese auf der <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Seite zur Registrierungsauthentifizierung</a>, die von der <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurationsseite des Tunnel-Managers</a> verlinkt ist. Die Registrierungsauthentifizierung stellt sicher, dass nur der Besitzer den Hostnamen registrieren oder verwalten kann und ist auf stats.i2p und reg.i2p erforderlich.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Benachrichtigungen &amp; Aktualisierungen";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Wenn Sie den Router nicht mit <code>i2p/i2prouter start</code> starten k\u00f6nnen, versuchen Sie es mit dem Skript <code>runplain.sh</code> im gleichen Verzeichnis. Zum Ausf\u00fchren von I2P+ sind nie Root-Rechte erforderlich. Wenn Sie die <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi-Bibliothek</a> (die in seltenen F\u00e4llen erforderlich ist) kompilieren m\u00fcssen, konsultieren Sie die Dokumentation, besuchen Sie die Foren oder besuchen Sie <a href=irc://127.0.0.1:6668/saltR class=chatlink>den I2P+-Kanal</a> oder <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>den IRC-Entwicklerkanal</a>.";
