    t[7459] = "Informationen, die die eindeutige Identit\u00e4t eines Routers im Netzwerk definieren, einschlie\u00dflich seiner IP-Adresse (oder der IP-Adressen der Zwischenstellen) und des empfangenden Ports, \u00f6ffentlicher Signierungs- und Verschl\u00fcsselungsschl\u00fcssel. Router-Identit\u00e4ten korrelieren mit Peers in der NetDB. Auch als <i>RouterInfo</i> bezeichnet.";
