    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Eine verteilte Datenbank, die Router-Kontaktinformationen (RouterInfos) und Zielkontaktinformationen (LeaseSets) enth\u00e4lt. Ein einzelner Router verwaltet seine eigene (partielle) Datenbank, um mit anderen Routern im Netzwerk zu kommunizieren; kein einzelner Router wird eine Liste aller Router verwalten. Die RouterInfos werden auf der Festplatte gespeichert und beim Start des Routers oder beim Erwerb neuer RouterInfos in den Arbeitsspeicher geladen. Auch als <i>NetDb</i> bezeichnet. Weitere Informationen finden Sie in der <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
    t[7692] = "Address";
    t[7693] = "Adresse";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Ein Schwellenwert wird durch die Anzahl der Verbindungsaufbauversuche definiert, die einem entfernten Ziel innerhalb einer angegebenen Anzahl von Sekunden erlaubt sind, bevor ein \"Versto\u00df\" auftritt.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet bezieht sich normalerweise auf das \u00f6ffentlich zug\u00e4ngliche Internet, im Gegensatz zum Darknet, das typischerweise die auf I2P, Tor usw. aufgebauten verschl\u00fcsselten, anonymen Dienste beschreibt. Weitere Informationen finden Sie im <a href=https://de.wikipedia.org/wiki/Clearnet_(Netzwerk) class='sitelink external' target=_blank rel=noreferrer>Wikipedia-Artikel</a>.";
