    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Legt die maximale Anzahl paralleler <a href=/jobs>Jobs</a> fest, die ausgef\u00fchrt werden k\u00f6nnen. Der Standardwert wird durch den der JVM \u00fcber <code>wrapper.config</code> zugewiesenen Speicher festgelegt und liegt bei weniger als 64 MB bei 3, bei weniger als 256 MB bei 4 und bei mehr als 256 MB bei 5. Hinweis: Eine \u00c4nderung dieser Einstellung erfordert einen Neustart des Routers.";
