    t[7926] = "For the best experience, it's recommended to configure your bandwidth settings to match the values provided by your ISP. If you are unsure of your bandwidth, you can run a test to determine your download and upload speeds.";
    t[7927] = "F\u00fcr die beste Erfahrung wird empfohlen, Ihre Bandbreiteneinstellungen an die Werte anzupassen, die von Ihrem Internetdienstanbieter bereitgestellt werden. Wenn Sie sich unsicher \u00fcber Ihre Bandbreite sind, k\u00f6nnen Sie einen Test durchf\u00fchren, um Ihre Download- und Upload-Geschwindigkeiten zu ermitteln.";
