    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Ein Router im Netzwerk, der mit der Bereitstellung und dem Empfang von Informationen \u00fcber andere Router und Dienste im Netzwerk beauftragt ist. Die derzeitige Mindestbandbreiten-Freigabe f\u00fcr einen Router, um als f\u00e4hig zur \u00dcbernahme von Floodfill-Aufgaben zu gelten, betr\u00e4gt 128 KBytes/Sekunde, auch wenn es m\u00f6glich ist, diese Anforderung zu \u00fcberschreiben und einen Router auf der <a href=/configadvanced>Erweiterten Konfigurationsseite</a> erzwingend zum Floodfill zu machen. Weitere Informationen finden Sie in der <a href=https://geti2p.net/de/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
