    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Wo immer m\u00f6glich sollten Ressourcen, die wiederholt auf Ihrer Website verwendet werden, aus einer externen Datei geladen und nicht inline eingef\u00fcgt werden. Wenn Sie dieselbe CSS auf mehreren Seiten verwenden, erstellen Sie eine separate CSS-Datei und laden Sie diese im <code>&lt;head&gt;</code>-Abschnitt Ihrer Seiten. Dadurch werden Stilaktualisierungen Ihrer Website einfacher zu verwalten und die Datei kann auch im Browser des Besuchers zwischengespeichert werden, was zu geringeren Bandbreitenanforderungen an Ihren Webserver und schnelleren Seitenaufbauten f\u00fcr Ihre Besucher f\u00fchrt.";
