    t[8253] = "Hilfebereich";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "Konfiguration von I2P+: Netzwerk, Firefox, Tunnelverwaltung";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Wenn Sie meinen, Sie haben Ihre Firewall ge\u00f6ffnet und I2P breichtet dennoch, es w\u00e4re hinter einer Firewall, dann pr\u00fcfen Sie, ob Sie m\u00f6glicherweise mehrere Firewalls - zum Beispiel sowohl Software- als auch externer Hardware-Router - haben.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Das Schl\u00fcsselwort <i class=example>deny</i>. Dieser Schwellenwert wird immer verletzt, d.h. es sind keine Verbindungsaufbauversuche erlaubt.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "protokolliere Besucher, die 90 oder mehr Verbindungen pro Minute herstellen";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Sie haben eingehendes TCP konfiguriert, jedoch ist ihr UDP-Port hinter einer Firewall. Deswegen ist es wahrscheinlich, dass Ihr TCP-Port auch hinter einer Firewall ist.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Dies ist die Anzahl der Peers, die Ihr Router f\u00fcr Netzwerkdatenbankabfragen verwendet. Dies sind normalerweise die <i>floodfill</i>-Router, die f\u00fcr die Aufrechterhaltung der Netzwerkintegrit\u00e4t verantwortlich sind. Ihre gut integrierten Peers werden am Ende der <a href='/profiles'>Profilseite</a> angezeigt.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Router-Webapps verwalten";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "Ausgehender TCP-Verkehr von zuf\u00e4lligen hohen Ports zu zuf\u00e4lligen entfernten TCP-Ports.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Nach dem Start von I2P kann es ein paar Minuten dauern, den Router ins Netzwerk zu integrieren (bootstrap) und weitere Teilnehmer zu finden. Bitte Geduld haben.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Keine Datei angegeben. Bitte w\u00e4hlen Sie eine g\u00fcltige .ZIP- oder .su3 -Datei aus, um neu zu s\u00e4en.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
