    t[8323] = "Unbekannte Assistentenseite";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "nur IPv6 NTCP, SSU, Introducer";
    t[8332] = "Messages sent to peer";
    t[8333] = "An Peer gesendete Nachrichten";
    t[8334] = "Function";
    t[8335] = "Funktion";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Im I2P-Netzwerk k\u00f6nnen entfernt gehostete Dienste \u00fcber eine <a href=https://de.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a>-Adresse mit der Endung \".b32.i2p\", einem <i>Ziel</i> in Form einer langen <a href=https://de.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>-Zeichenkette oder h\u00e4ufiger durch Verwendung einer .i2p-Domain aufgerufen werden. Ein Ziel ist das \u00c4quivalent von I2P zu einer IP-Adresse und wird auf der <a href='/i2ptunnel/edit?tunnel=3'>Tunnel-Manager-Konfigurationsseite</a> angezeigt. Sie k\u00f6nnen Ihre b32.i2p-Adresse teilen, um anderen den Zugriff auf Ihre Website zu erm\u00f6glichen, bis Sie Ihre eigene .i2p-Domain registriert haben.";
