    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Geben Sie den Namen ein und f\u00fcgen Sie das Ziel in Ihr <a href='/dns?book=router&amp;filter=none'>Adressbuch</a> ein. Klicken Sie auf <i>Hinzuf\u00fcgen</i>, um den neuen Eintrag zu speichern.";
