    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "Recorder halten die Verbindungversuche eines entfernten Ziels fest und wenn diese den definierten Schwellenwert \u00fcberschreiten, wird das Ziel in der angegebenen Datei protokolliert. Es k\u00f6nnen mehrere Recorder angegeben werden:";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(Das Zeichen '@' wird bei der Rotation der Protokolle ersetzt)";
    t[8376] = "Updated settings for all pools.";
