    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Um das Anzeigen von Verzeichnislisten zu deaktivieren, suchen Sie den Eintrag <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in der Datei <code>base-context.xml</code>, die sich im Ordner <code>eepsite/contexts</code> (direkt \u00fcber dem docroot-Ordner) befindet, und \u00e4ndern Sie 'true' in 'false' unmittelbar darunter. Um die \u00c4nderung sofort anzuwenden, stoppen und starten Sie den <i>I2P Webserver</i>-Client auf der <a href=/configclients>Client-Konfigurationsseite</a>. Sie k\u00f6nnen auch eine leere Datei mit dem Namen <code>index.html</code> in einem beliebigen freigegebenen Verzeichnis ablegen, um das Anzeigen von Verzeichnislisten f\u00fcr diesen Speicherort zu unterdr\u00fccken.";
