    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Logs</a> k\u00f6nnen bei der L\u00f6sung eines Problems hilfreich sein. Sie k\u00f6nnen Ausz\u00fcge in einem <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>Forum</a> f\u00fcr Hilfe ver\u00f6ffentlichen oder es stattdessen <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>hier einf\u00fcgen</a> und den Link im IRC zur Hilfe angeben.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Plugins, die mit dem kryptographischen Schl\u00fcssel des Entwicklers signiert sind, sind das empfohlene Format, aber wenn Sie nicht signierte Plugins (.zip) installieren m\u00f6chten, k\u00f6nnen Sie dies hier aktivieren. Beachten Sie, dass Sie bei der Installation nicht signierter Plugins weiterhin auf Probleme sto\u00dfen k\u00f6nnen, wenn der Entwickler zus\u00e4tzliche \u00dcberpr\u00fcfungen in den Erstellprozess des Plugins eingebaut hat.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Wenn Sie eine eigenst\u00e4ndige Tor-Instanz lokal verwenden, k\u00f6nnen Sie diese verwenden, indem Sie I2P wie folgt konfigurieren: <i>Proxytyp:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "W\u00e4hlen Sie die Sprache, die f\u00fcr die Router-Konsole und Webanwendungen (<a href=/webmail target=_blank rel=noreferrer>Webmail</a>, <a href=/torrents target=_blank rel=noreferrer>Torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>Tunnel Manager</a> usw.) verwendet werden soll. Wenn Sie die Sprache in Zukunft \u00e4ndern, das Router-Konsolen-Design \u00e4ndern oder ein Passwort f\u00fcr den Zugriff auf die Konsole konfigurieren m\u00f6chten, k\u00f6nnen Sie dies auf der <a href=/configui target=_blank rel=noreferrer>Benutzeroberfl\u00e4chenkonfigurationsseite</a> tun.";
