    t[9052] = "Ready";
    t[9053] = "Bereit";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Dies sind die lokalen Dienste, die Ihr Router bereitstellt. Sie k\u00f6nnen Clients sein, die \u00fcber den <a href='/i2ptunnelmgr'>Tunnel Manager</a> gestartet werden, oder externe Programme, die \u00fcber SAM, BOB oder direkt \u00fcber I2CP eine Verbindung herstellen. Standardm\u00e4\u00dfig teilen sich die meisten Ihrer Clientdienste (E-Mail, HTTP-Proxy, IRC) den gleichen Satz von Tunnels und werden als <i>Gemeinsame Clients</i> und <i>Gemeinsame Clients (DSA)</i> aufgef\u00fchrt, was die Anonymit\u00e4t verbessert, indem der Datenverkehr aller gemeinsam genutzten Dienste gemischt wird, und den Aufwand zur Erstellung und zum Warten der Tunnels reduziert. Wenn Sie jedoch einen Tunnelausfall erleben, werden alle Ihre Dienste gleichzeitig offline gehen, daher m\u00f6chten Sie in einigen Szenarien m\u00f6glicherweise die Konfiguration der Clientdienste so anpassen, dass sie ihren eigenen Satz von Tunnels verwenden. Dies kann erreicht werden, indem Sie die Option <i>Tunnels mit anderen Clients teilen&hellip;</i> auf der Konfigurationsseite des jeweiligen Clientdienstes im Tunnel Manager deaktivieren. Anschlie\u00dfend m\u00fcssen Sie den Clientdienst von der <a href='/i2ptunnelmgr'>Hauptseite des Tunnel Managers</a> neu starten.";
