    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Eine einfache CGI-Anwendung, die einen Hostnamen als Parameter entgegennimmt und eine 301-Weiterleitung zur richtigen URL mit einem angeh\u00e4ngten <code>?i2paddresshelper=key</code> String zur\u00fcckgibt. Der HTTP-Proxy interpretiert den angeh\u00e4ngten String und verwendet den Schl\u00fcssel als eigentliche Zieladresse. Dar\u00fcber hinaus cached der Proxy den Schl\u00fcssel, sodass der Adresse-Helper bis zum Neustart nicht erforderlich ist, und bietet die M\u00f6glichkeit, die aufgel\u00f6ste Adresse dem Adressbuch hinzuzuf\u00fcgen.";
