    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Neuausstattung ist der Startvorgang, mit dem Sie andere Router finden, wenn Sie I2P zum ersten Mal installieren oder wenn Ihr Router zu wenige Routerreferenzen aufweist. Die Standardeinstellungen funktionieren f\u00fcr die meisten Benutzer. \u00c4ndern Sie diese nur, wenn HTTPS von einer restriktiven Firewall blockiert wird und die Neuausstattung fehlgeschlagen ist.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Diese Einstellung \u00e4ndert bei Aktivierung die maximale zus\u00e4tzliche zuf\u00e4llige Pong-Verz\u00f6gerung f\u00fcr pingf\u00e4hige Server, wenn auch <code>i2p.streaming.enablePongDelay</code> aktiviert ist. Wird sie nicht explizit gesetzt, wird der Standardwert von 50 ms verwendet.";
