    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Ihr I2P+ Router tr\u00e4gt standardm\u00e4\u00dfig zum Netzwerk bei, indem er den internen, ende-zu-ende verschl\u00fcsselten Verkehr f\u00fcr andere Router routet, bekannt als <i>Teilnahme</i>. Die Beteiligung am Bandbreitenverkehr verbessert das Anonymit\u00e4tsniveau aller Benutzer im Netzwerk und maximiert Ihre Download-Geschwindigkeit.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Diese Einstellung erm\u00f6glicht die Konfiguration alternativer NTP-Server, um sicherzustellen, dass die Uhrzeit des Routers genau bleibt. [Standardm\u00e4\u00dfig sind es 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimieren Sie Ihre Bilder";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Beachten Sie, dass der Profiler auf die kontinuierliche Nutzung des Client-Tunnels angewiesen ist, um ein genaues Profil der Peers zu erstellen.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Wenn Sie es eilig haben und nicht ein paar Stunden warten k\u00f6nnen, k\u00f6nnen Sie den Leuten sagen, sie sollen einen 'Jump'-Adresshilfsweiterleitungsdienst verwenden. Dies funktioniert in der Regel innerhalb weniger Minuten, nachdem Sie Ihren Hostnamen auf derselben Website registriert haben. Testen Sie es selbst, indem Sie <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> in Ihren Browser eingeben. Sobald es funktioniert, k\u00f6nnen Sie es anderen mitteilen.";
