    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Beachten Sie, dass der vollst\u00e4ndige Pfad zu den Ausgabedateien vor der Bereitstellung des Filters zug\u00e4nglich sein muss. Wenn das Zielverzeichnis nicht vorhanden ist, werden die Ziele nicht aufgezeichnet und es erscheint ein Fehler in den Router-Protokollen. Die Dateien werden bei Bedarf erstellt. Die oben bereitgestellten Beispiele sind keine Empfehlungen; Ihre Konfiguration sollte entsprechend der Menge an Inhalt (Anzahl und Gr\u00f6\u00dfe der Dateien), die Ihr Server bereitstellt, der Geschwindigkeit des Servers und der H\u00e4ufigkeit, mit der die Website aktualisiert wird, angepasst werden. Durch die Konfiguration von Recordern und die \u00dcberwachung der resultierenden Dateien k\u00f6nnen Sie die Einstellungen optimieren.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
