    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunnel, die von anderen Routern \u00fcber Ihren Router aufgebaut werden. Dies kann je nach Netzwerkauslastung, Ihrer gemeinsam genutzten Bandbreite und der Menge des lokal generierten Datenverkehrs stark variieren. Die empfohlene Methode, um die Anzahl der teilnehmenden Tunnel zu begrenzen, besteht darin, Ihren Anteil auf der Seite <a  href='/config'>Bandbreitenkonfiguration</a> zu \u00e4ndern. Sie k\u00f6nnen auch die Gesamtanzahl begrenzen, indem Sie <code>router.maxParticipatingTunnels=nnn</code> auf der Seite <a href='/configadvanced'>Erweiterte Konfiguration</a> festlegen. <a href='/configstats#tunnel.participatingTunnels'>[Grafik aktivieren]</a>.";
