    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Um einen alternativen Webserver f\u00fcr die Verwendung in I2P zu konfigurieren, k\u00f6nnen Sie entweder den vorhandenen Webserver-Tunnel verwenden und den <a href=/configclients>Standard-Webserver deaktivieren</a> oder einen neuen HTTP-Server-Tunnel im <a href=/i2ptunnelmgr>Tunnel-Manager</a> erstellen. Stellen Sie sicher, dass der <i>Empfangsport</i> des Webservers auch in den Einstellungen des Tunnel-Managers konfiguriert ist. Wenn Ihr Webserver beispielsweise standardm\u00e4\u00dfig auf der Adresse 127.0.0.1 und Port 80 lauscht, m\u00fcssen Sie auch sicherstellen, dass der <i>Zielpunkt</i> auf der Einstellungsseite des Tunnel Managers f\u00fcr den Dienst ebenfalls auf Port 80 konfiguriert ist.";
