    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Ein I2P Router muss normalerweise nur einmal auss\u00e4t werden, um zum ersten Mal am Netzwerk teilzunehmen. Wenn der Router jedoch f\u00fcr eine l\u00e4ngere Zeit ohne Netzwerkverbindung l\u00e4uft, muss er m\u00f6glicherweise auch neu ausges\u00e4t werden. Das Auss\u00e4en beinhaltet das Abrufen mehrerer \"RouterInfo\"-Dateien (die in einer signierten ZIP-Datei zusammengefasst sind) von mindestens zwei vordefinierten Server-URLs, die aus einer von Freiwilligen betriebenen Gruppe von Clearnet-HTTPS-Servern ausgew\u00e4hlt wurden.";
    t[10050] = "Are you sure you want to delete {0}?";
    t[10051] = "Sind Sie sicher, dass Sie {0} l\u00f6schen wollen?";
