    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Eine Liste von L\u00e4ndern, die aus dem <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> mit einem schlechten Ruf in Bezug auf b\u00fcrgerliche Freiheiten abgeleitet wurde. Diese Liste wird verwendet, um Router, die in den angegebenen L\u00e4ndern ausgef\u00fchrt werden, im <i>Hidden Mode</i> zu platzieren, um erweiterte Sicherheit f\u00fcr Benutzer zu bieten. Die folgenden L\u00e4nder gelten als streng: Afghanistan, Aserbaidschan, Bahrain, Wei\u00dfrussland, Brunei, Burundi, Kamerun, Zentralafrikanische Republik, Tschad, China, Kuba, Demokratische Republik Kongo, \u00c4gypten, \u00c4quatorialguinea, Eritrea, \u00c4thiopien, Iran, Kasachstan, Laos, Libyen, Myanmar, Nordkorea, Pal\u00e4stinensische Gebiete, Ruanda, Saudi-Arabien, Somalia, S\u00fcdsudan, Sudan, Eswatini (Swasiland), Syrien, Tadschikistan, Thailand, T\u00fcrkei, Turkmenistan, Venezuela, Vereinigte Arabische Emirate, Usbekistan, Westsahara, Jemen.";
