    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Eine beschr\u00e4nkte Auswahl an Statistiken ist standardm\u00e4\u00dfig aktiviert und wird zur \u00dcberwachung der Router-Leistung ben\u00f6tigt. Nur Statistiken, f\u00fcr die optionale Grafiken verf\u00fcgbar sind, werden hier aufgelistet; f\u00fcr eine vollst\u00e4ndige Liste der aktivierten Statistiken besuchen Sie bitte die <a href=/stats>Statistikseite</a>.";
    t[10298] = "Reseed complete, check summary bar for status";
