    t[10306] = "Once green stars are indicated next to your Local Tunnels, there is a wide variety of things you can do with I2P.";
    t[10307] = "Sobald neben den lokalen Tunnelverbindungen gr\u00fcne Sterne angezeigt werden steht eine Vielzahl m\u00f6glicher Anwendungen mit I2P zur Verf\u00fcgung.";
    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "Bitte warten Sie, bis die Weiterleitung f\u00fcr {0} Tunnel beendet ist.", "Bitte warten Sie, bis die Weiterleitungen f\u00fcr {0} Tunnel beendet sind." };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Soweit wie m\u00f6glich, stellen Sie bitte sicher, dass I2P+/Java den bidirektionalen Portzugriff aus dem Internet erlaubt, indem Sie Ihren Modem/Router/PC-Firewall entsprechend konfigurieren. Wenn Sie sich hinter einer restriktiven Firewall befinden, aber uneingeschr\u00e4nken ausgehenden Zugriff haben, kann I2P+ trotzdem funktionieren. Sie k\u00f6nnen den eingehenden Zugriff deaktivieren und sich auf die <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) verlassen, um sich mit dem Netzwerk zu verbinden. Der Netzwerkstatus im Seitenbereich zeigt dann \"Status: Firewall\" an. F\u00fcr optimale Leistung stellen Sie bitte sicher, dass I2Ps <a href=/confignet#udpconfig>externer Port</a> aus dem Internet erreichbar ist (siehe unten f\u00fcr weitere Informationen).";
