    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Dienste k\u00f6nnen gleichzeitig auf mehreren Routern gehostet werden, indem sie denselben privaten Schl\u00fcssel f\u00fcr das Target teilen. Multihoming kann die Sicherheit und Stabilit\u00e4t eines Servers weiter verbessern, indem Redundanz bereitgestellt wird. Wenn ein Server multihomed ist und ein Server in der Pool abgeschaltet wird, bleibt der bereitgestellte Dienst weiterhin verf\u00fcgbar, was es schwieriger macht, die Ausfallzeit des Servers mit dem Offline-Gehen eines Routers zu korrelieren.";
    t[10672] = "Client Configuration";
    t[10673] = "Client-Konfiguration";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "Stellen Sie sicher, dass Ihr Java auf dem neuesten Stand ist. Version 1.8 oder h\u00f6her ist erforderlich; Version 11 oder h\u00f6her wird empfohlen. \u00dcberpr\u00fcfen Sie Ihre Java-Version oben auf der <a href=/info>Router-Informationssseite</a>.";
