    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Der Vorgang, Router-Identit\u00e4ten zu erlangen, normalerweise \u00fcber <i>Clearnet</i>-Server, um sicherzustellen, dass Ihr Router mit anderen Routern im Netzwerk kommunizieren und Tunnel aufbauen kann. Wenn ein Router keine Router-Identit\u00e4ten f\u00fcr andere Peers hat (normalerweise unmittelbar nach der Installation), wird der Vorgang des Neusehens auch als <i>Bootstrapping</i> bezeichnet.";
