    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Ein Tunnel, der vom Router verwendet wird, um mit anderen Router zu kommunizieren und verschiedene \u201eHauskeeping\u201c-Funktionen wie Lernen und Ver\u00f6ffentlichen von <i>Leasesets</i>, Testen von Client-Tunnels sowie Lernen und Validieren anderer Router im Netzwerk durchzuf\u00fchren. Diese Tunnels haben normalerweise eine niedrige Bandbreite.";
    t[10752] = "Debug";
