    t[11021] = "Kann nicht ins Zusatzprogrammverzeichnis {0} schreiben";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Standardm\u00e4\u00dfig verwendet I2P den systemkonfigurierten Standardbrowser zum Starten beim Start. Wenn Sie einen alternativen Browser verwenden m\u00f6chten, m\u00fcssen Sie Ihre router.config-Datei (oder die <a href=/configadvanced>Erweiterte Konfigurationsseite</a>, wenn Sie den erweiterten Konsolenmodus aktiviert haben) bearbeiten und eine neue Konfigurationszeile hinzuf\u00fcgen: <code>routerconsole.browser=/pfad/zum/browser</code> oder <code>routerconsole.browser=\\pfad\\zum\\browser.exe</code> f\u00fcr Windows, wobei <code>\\pfad\\zum\\browser</code> durch den Pfad zum zu verwendenden Browser ersetzt wird. Hinweis: Wenn der Pfad zu Ihrem gew\u00e4hlten Browser Leerzeichen enth\u00e4lt, m\u00fcssen Sie den Pfad m\u00f6glicherweise in Anf\u00fchrungszeichen setzen, z.B. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
