    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Diese Einstellung (in Stunden) erm\u00f6glicht das manuelle Konfigurieren des Alters eines RouterInfo, um vom Refresh Routers Job \u00fcberpr\u00fcft zu werden. Standardm\u00e4\u00dfig skaliert das Alter eines RouterInfo bevor ein Refresh initiiert wird entsprechend der Gr\u00f6\u00dfe des NetzDBs und erh\u00f6ht sich mit wachsender NetzDB-Gr\u00f6\u00dfe. Ein Wert von 0 erzwingt, dass der Router Refresh Job jeden Router im NetzDB unabh\u00e4ngig vom Alter \u00fcberpr\u00fcft.";
