    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Eine I2P-Webanwendung, die Dienstziele f\u00fcr das Netzwerk verwaltet, indem sie B64-Hashes in lesbare Namen abbildet. Ziele k\u00f6nnen manuell oder \u00fcber hosts.txt-Dateien hinzugef\u00fcgt werden. Wird auch als SusiDNS bezeichnet. Weitere Informationen finden Sie in der <a href=https://geti2p.net/de/docs/naming class='sitelink external' target=_blank rel=noreferrer>Online-Dokumentation</a>.";
