    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Um einen Satz von Tunneln f\u00fcr mehrere Client-Dienste zu verwenden, k\u00f6nnen Clients vom <i>Tunnel Manager</i> konfiguriert werden, um im <i>Shared-Client</i>-Modus zu arbeiten. Dieser Modus spart Ressourcen und vermischt den Traffic von mehreren Clients in einem Satz von Tunneln, was die Verkehrsanalyse erschwert. Als gemeinsame Clients konfigurierte Clients teilen die gleichen Tunneloptionen.";
