    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Ihr Modem oder Router kann <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP) unterst\u00fctzen, was automatische Portweiterleitung erm\u00f6glicht. Stellen Sie sicher, dass UPnP-Unterst\u00fctzung f\u00fcr I2P+ auf der <a href=/confignet>Konfigurationsseite</a> aktiviert ist und versuchen Sie dann, UPnP auf Ihrem Modem/Router und m\u00f6glicherweise auch auf Ihrem Computer zu aktivieren. Versuchen Sie nun, den <a href=/>I2P+-Router</a> neu zu starten. Bei erfolgreichem Test sollte I2P+ im Seitenpanel \u201eStatus: OK\u201c melden, sobald der I2P+-Router die anf\u00e4nglichen Konnektivit\u00e4tstests abgeschlossen hat.";
